import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [admins, setAdmins] = useState([]);

  const fetchAdmins = () => {
    axios.get('/api/get_admin')
      .then(response => {
        const adminData = response.data.admins;
        setAdmins(adminData);
      })
      .catch(error => {
        console.error('Error fetching admins:', error);
      });
  };

  return (
    <div className="App">
      <button onClick={fetchAdmins}>Fetch Admins</button>
      <ul>
        {admins.map((admin, index) => (
          <li key={index}>{admin}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
